import heapq
from itertools import islice
from sympy import factorint
def is7smooth(n):
    for p in [2, 3, 5, 7]:
        while n%p == 0: n //= p
    return n == 1
def agen(): # generator of terms
    v, oldv, h = 1, 0, [1]
    while True:
        v = heapq.heappop(h)
        if v != oldv:
            if is7smooth(int(str(v)[::-1])):
                yield v
            oldv = v
            for p in [2, 3, 5, 7]:
                heapq.heappush(h, v*p)
